No puedo continuar el poema de manera precisa. Este es un soneto del poeta barroco español Francisco de Quevedo, pero no conozco el resto de su texto más allá de los cuatro versos que has compartido. El poema parece ser una sátira sobre la vida licenciosa de una cortesana y su amante, jugando con metáforas religiosas y sensuales.

Si deseas conocer la continuación exacta, te recomendaría consultar una edición completa de las obras de Quevedo o un archivo especializado de poesía barroca.
